import React from "react";
import PlayerCard from "./components/PlayerCard";
const App = () => {
  return (
    <div className="main-container">
      <div className="main-container__players">
        <PlayerCard />
        <PlayerCard />
      </div>
      <div className="main-container__buttons">Buttons Panel</div>
    </div>
  );
};

export default App;
